import FormProduct from "./components/FormProduct";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
    <div>
      <Routes>
        <Route path="/" E={ <FormProduct />}/>
      </Routes>
    </div>
    </BrowserRouter>
  );
}

export default App;
